import React, { Component } from 'react'

export default class index extends Component {
  render() {
    const list = [
      { id: 1, title: 'one' },
      { id: 2, title: 'two' },
      { id: 3, title: 'three' },
    ]

    return (
      <ul>
        <li>
          <a href="/message1">message001</a>&nbsp;&nbsp;
                    </li>
        <li>
          <a href="/message2">message002</a>&nbsp;&nbsp;
                    </li>
        <li>
          <a href="/message/3">message003</a>&nbsp;&nbsp;
                    </li>
      </ul>

    )
  }
}
